import React from "react";
import { amplitude, exedente, exedenteHum, tendencias } from "../util/avaliacao";


export default function Assessment() {
    return(<>
    
    <div className="avaliacoes">
      
      <div className="avaliacao ok">Amplitude térmica: {amplitude()}°C<br></br> porcentagem de dados fora do padrão: {exedente()}%<br></br>  Tendência de temperatura: ${tendencias()};</div>
    </div>
    
    
    
    </>)
}
